import './card.style.css';

export const card = props =>   (
    <div className='card-container'>
        <img alt='monster'
         src={`https://robohash.org/${props.monster.id}?set=set2&size=180*180`}
        />
     <h2>{props.monster.name}</h2>
     <p>{props.monster.email}</p>
    </div>
)
